const Navigation = () => {
    return (

        <header className="navigation">
            <div className="Navigation_Container">
                <h1></h1>
                <ul className="menu">
                    <li className="menu_item">
                        Accueil
                    </li>
                    <li className="menu_item">
                        Contact
                    </li>
                    <li className="menu_item">
                        Github
                    </li>
                </ul>
            </div>
        </header>
    );
};

export default Navigation;
